import React, { useState } from 'react';
import Button from './Button';
import Input from './Input';
import '../styles/ColorScheme.css';
import '../styles/AdminLogin.css';
import logo from '../assets/logos/logo.png';

function AdminLogin() {


    return (
        <div className="admin-login-container">
            <div className="admin-login-logo-container">
                <img className="admin-login-logo" src={logo} alt="ElectWise" />
            </div>
            <div className="admin-login-input-container">
                <Input placeholder="Username" onChange={handleTextChange} name="field-username" />
            </div>
            <div className="admin-login-input-container">
                <Input placeholder="Password" onChange={handleDateChange} name="field-password" />
            </div>
            <div className="admin-login-submit-container">
                <Button text="Submit" enabled={isReadySubmit} variant="bg-primary-outline" />
            </div>
        </div>
    );
}

export default AdminLogin;
